import '../Styles/Clock.css';
import { BrowserRouter as Router, Link } from "react-router-dom";

function Pomodoro() {




  return (
    <div>
      <div className="clock">
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center"
          }}
        >
          <div className="hour">25</div>
          <Link to="/countdown" className="button" style={{ backgroundColor: "#e27f23" }}>Countdown</Link>

        </div>
        <div className="colon">:</div>

        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center"
          }}
        >
          <div className="minute">00</div>
          <Link to="/pomodoro" className="button" style={{ backgroundColor: "#ffb3b3" }}>Pomodoro</Link>
        </div>
      </div>
    </div>
  );
}

export default Pomodoro;
